RULES_ITEM.SQL_TEXT:
declare
    v_cf_id        number;

    v_trackor_type varchar2(5000);
    v_field_label  varchar2(5000);

begin

    v_cf_id := nvl(util.getvalnumbyid(:pk, :id_num), -1);
    if v_cf_id = -1 then
        util.setvalcharbyid(:pk, id.integrationfieldmapping.cf.ifm_trackor_type, null);
    util.setvalcharbyid(:pk, id.integrationfieldmapping.cf.ifm_ov_field_label, null);
        return;
    end if;

    begin
        select xt.xitor_type,
               pkg_label.get_label_program(cf.app_label_id)
          into v_trackor_type,
               v_field_label
          from config_field cf
          join xitor_type xt on (
               xt.xitor_type_id = cf.xitor_type_id
               and cf.config_field_id = v_cf_id
          );
    exception when no_data_found then
        util.raiseerror('Trackor type for field ID ' || v_cf_id || ' is not found');
    end;

    util.setvalcharbyid(:pk, id.integrationfieldmapping.cf.ifm_trackor_type, v_trackor_type);
    util.setvalcharbyid(:pk, id.integrationfieldmapping.cf.ifm_ov_field_label, v_field_label);

end;

declare
    v_integration_link varchar2(5000);
    v_integration_name varchar2(5000);

    v_integration_id number;

begin

    v_integration_link := nvl(util.getvalstrbyid(:pk, :id_num), 'N/A');
    if v_integration_link = 'N/A' then
        util.setvalcharbyid(:pk, id.integrationtrackor.cf.it_integration_name, null);
        return;
    end if;

    v_integration_id := nvl(regexp_substr(v_integration_link, '\d+'), -1);
    if v_integration_id = -1 then
        util.raiseerror('Link to Integration Hub doesn''t contain Integration ID number');
    end if;

    begin
        select integration_name
          into v_integration_name
          from integration
         where integration_id = v_integration_id;
    exception when no_data_found then
        util.raiseerror('Integration with Integration ID ' || v_integration_id || '  is not found');
    end;

    util.setvalcharbyid(:pk, id.integrationtrackor.cf.it_integration_name, v_integration_name);

end;

declare
    v_is_enabled       number;

    v_integration_name varchar2(5000);
    v_integration_url  varchar2(5000);

begin

    v_is_enabled := util.getvalcheckboxbyid(:pk, :id_num);
    if v_is_enabled = 0 then
        return;
    end if;

    v_integration_name := nvl(util.getvalstrbyid(:pk, id.integrationtrackor.cf.it_integration_name), 'N/A');
    v_integration_url  := nvl(util.getvalstrbyid(:pk, id.integrationtrackor.cf.it_link_to_integration_hub), 'N/A');
    if v_integration_name = 'N/A'
       or v_integration_url = 'N/A'
    then
        util.raiseerror('You must set the URL to IT:Link to Integration Hub field before setting the Integration Enabled flag');
    end if;

end;

declare
    c_dynamic_dates constant varchar2(50) := 'dynamic_dates';

    v_sf            varchar2(500);
    v_dp            varchar2(500);
    
    v_is_static     number := 0;

begin

    v_sf := nvl(util.getvalstrbyid(:pk, id.integrationfieldmapping.cf.ifm_task_sf), 'N/A');
    v_dp := nvl(util.getvalstrbyid(:pk, id.integrationfieldmapping.cf.ifm_task_date_pair), 'N/A');
    if v_sf <> 'N/A'
       and v_dp <> 'N/A'
    then

        select count(*)
          into v_is_static
          from v_wp_task_date_type
         where is_static = 1
           and wp_task_date_type = v_dp;

        if v_dp in ('Early Date', 'Late Date') then
            v_dp := replace(v_dp, ' Date');
        end if;

        if v_is_static = 1 then
            v_dp := lower(v_dp);
            v_dp := v_dp || '_' || v_sf;
        else
            v_dp := c_dynamic_dates || '.' || v_dp || '.' || v_sf;
        end if;

        util.setvalcharbyid(:pk, 1000070345 /*IFM_TASK_DATA*/, v_dp);
    
    else
        util.setvalcharbyid(:pk, 1000070345 /*IFM_TASK_DATA*/, null);

    end if;

end;
